G = function(mod) {
	if(typeof mod === "string") {
		mod = require(mod)
	}
	for(k in mod) {
		global[k] = mod[k]
	}
	return mod
}



if((typeof process) !== 'undefined') {
	// we're in node.js (versus browser)
	module.exports = G

	if(require && require.main === module) {
		// this module is being executed directly; run test
